import React from "react";
import "./Main.css";

const Main = () => {
  return (
    <div className="content">
      {/* Header */}
      <header className="header">
        <h1>Build advanced chatbots visually</h1>
        <p>Typebot gives you powerful blocks to create unique chat experiences.</p>
        <button className="create-btn">Create a FormBot for free</button>
      </header>

      {/* Main Content */}
      <div className="main">
        {/* Sidebar */}
        <aside className="sidebar">
          <h3>Blocks</h3>
          <ul>
            <li>Text</li>
            <li>Image</li>
            <li>Video</li>
            <li>Menu</li>
            <li>Button</li>
            <li>Email</li>
          </ul>
        </aside>

        {/* Flow Editor */}
        <div className="flow-editor">
          <h2>Flow Editor</h2>
          <div className="flow-area">
            {/* Sample Blocks */}
            <div className="block">Menu</div>
            <div className="block">Bug</div>
            <div className="block">Question</div>
            <div className="block">Email</div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default App;
